import React, { useState } from 'react';


const App = () => {

    const [clients, setClients] = useState([
        { id: 1, nom: "Marco Henikaja" },
        { id: 2, nom: "Rakoto Bogosy" },
        { id: 3, nom: "Randria Vendrana" },
    ])
    return (
        <div>
            <h3>Liste Clients</h3>
            <p>{clients.map((client) => <li>{client.nom} <button></button> </li>)}</p>

        </div>
    );
};

export default App;
